import React from 'react';
import CategoryList from '../components/CategoryList';
import CreateCategory from './components/CreateCategory';

const CategoryView = () => {
return (
    <div>
        <Route path="/create" component={CreateCategory} />
    <CategoryList />
    </div>
);
};

export default CategoryView;
